export default function Card(props){

    return(

        <div className="w-52 h-52 bg-green-500 p-2 m-2 inline overflow-y-scroll">
       <div>
       <img src={props.url} alt="no available"></img>
       </div>
       <div className="flex ">
       <p>{props.name}</p>
       <p>{props.price}</p>
       </div>
       <div>
       {props.description}
       </div>
        </div>

    )
}
